import Header from "../Header";

import Footer from "../Footer";
function Contact() {
  return (
    <div>
    <Header />
    <div className="row">
      <div className="col-12 my-3">
        <h1 className="text-center py-3 blue-color">
          Feel free to contact me
        </h1>
      </div>
    </div>
    <Footer />
  </div>
  );
}

export default Contact;
